import React from 'react'
import { Link,Route,BrowserRouter as Router } from 'react-router-dom';

function Header() {

    const arr = [
        {id:0,title:"hakkimizda"},
        {id:1,title:"iletisim"},
        {id:2,title:"profil"},
        {id:3,title:"uyeler"}
    ];

    return (
           <div className="nav">
                <ul>
                    <li>
                        <Link to="/">
                            Anasayfa
                        </Link>
                    </li>
                    {arr.map((tit,index) => (
                    <li key={index}>
                        <Link to={`/${tit.title}`} params={tit.title}>
                            {tit.title}
                        </Link>
                    </li>
                    ))}
                </ul>
            </div>
    )
}

export default Header;
